import React from "react";
import LoginForm from "./login";

function Home() {
  return (
    <div>
      <div class="container-fluid">
        <div class="row">
          <h1>DiveIn</h1>
          <h2>Start Learning Right Away</h2>
          <p>
            We aim to help you develop knowledge. Just choose your topic of
            interest, and start reading.{" "}
          </p>
          <p>
            Each piece of content is from one of the top bloggers in the
            respective fields. So, dive right in! :)
          </p>
        </div>
        <div className="row">
          <LoginForm></LoginForm>
        </div>
      </div>
    </div>
  );
}
export default Home;
